import React, { useState } from 'react';
import './Navbar.css';



const Navbar = () => {
    const [active, setActive] = useState(false)
    const handleActive = () => {
        setActive(!active)

    }
    const [isNavExpanded, setIsNavExpanded] = useState(false)
    return (
        <nav className='navigate'>
            <a href='/' className='name'>Name</a>
            <button className="menu-btn" onClick={() => {
                setIsNavExpanded(!isNavExpanded)
            }}>
                {
                    isNavExpanded ? <i class="fa-solid fa-xmark"></i> : <i class="fa-solid fa-bars"></i>
                }
            </button>
            <div className={
                isNavExpanded ? "menu expanded" : "menu"
            }>
                <ul>
                    <li onClick={handleActive} className={active ? { active } : 'menu li a'}><a href='/'>Home</a></li>
                    <li ><a href='/Events'>Events</a></li>
                    <li ><a href='/Registration'>Registration</a></li>
                    <li ><a href='/login' className='login-btn'>Login</a></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar
